import React from 'react'
import './Item.css'

function Items(props) {
    const items = props.items;
    const listItems = items.map(item => {
        return (<div className='list' key={item.key}>
            <p>{item.text}</p>

        </div>)
    })
    return(
        <div>
            {listItems}
        </div>
    )
 
}



export default Items
